_TS-1079\r\n  Scenario Outline: [CypressCoverage]google account linked to lifemiles blocked account\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the first button that contains the text \"Continuar con numero o usuario Lifemiles\"\r\n    Then I type the \"<gmail>\" in the \"correo electronico\" field and the \"<password>\" in the \"Contrasena\" field\r\n    When I click on the log in button a error page appears with an error code\r\n    Then I validate de \"<code>\" and message\r\n\r\n    Examples:\r\n      | Code    |\r\n      | E: 1098 |\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @TEST_TS-1078\r\n  Scenario Outline: [CypressCoverage] google account linked to lifemiles Suspended account\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the first button that contains the text \"Continuar con numero o usuario Lifemiles\"\r\n    Then I type the \"<gmail>\" in the \"correo electronico\" field and the \"<password>\" in the \"Contrasena\" field\r\n    When I click on the log in button a error page appears with an error code\r\n    Then I validate de \"<code>\" and message\r\n\r\n    Examples:\r\n      | Code    |\r\n      | E: 1099 |\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @TEST_TS-1076\r\n  Scenario Outline: [CypressCoverage] google account linked to lifemiles blacklisted account\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the first button that contains the text \"Continuar con numero o usuario Lifemiles\"\r\n    Then I type the \"<gmail>\" in the \"correo electronico\" field and the \"<password>\" in the \"Contrasena\" field\r\n    When I click on the log in button a error page appears with an error code\r\n    Then I validate de \"<code>\" and message\r\n\r\n    Examples:\r\n      | Code    |\r\n      | E: 1104 |\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @TEST_TS-1077\r\n  Scenario Outline: [CypressCoverage] google account without accepting terms and conditions\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the second button that contains the text \"Continuar con Google\"\r\n    Then The google authentication section loads\r\n    When I type the \"<gmail>\" in the \"Correo electronico\" field and the \"<Password>\" in the \"Contrasena\" field\r\n    Then I click on the \"Ingresar\" button\r\n    When Loads the error modal with the TyC banner\r\n    Then Validate the message\r\n\r\n    Examples:\r\n      | tst |\r\n      | tst |\r\n\r\n\r\n\r\n\r\n  #Escenarios agregados de vinculacion manual y sugerida el 21-05-2024\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @TEST_TS-1162\r\n  Scenario Outline: [CypressCoverage] link the google account to the suggested lifemiles account that is associated with that email address\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the second button that contains the text \"Continuar con Google\"\r\n    Then The google authentication section loads\r\n    When I type the \"<gmail>\" in the \"Correo electronico\" field and the \"<Password>\" in the \"Contrasena\" field\r\n    Then I click on the \"Ingresar\" button\r\n    When Loads the view \"Tu correo está asociado con una cuenta LifeMiles\"\r\n    And last 4 digits of the associated membershipnumber is preloaded in the \"Numero de LifeMiles\"\r\n    Then I type the \"<LifemilesPassword>\" in the \"ingresa tu contraseña LifeMiles\" field\r\n    And I click on the \"Mostrar\" button\r\n    When I click on the \"Vincula tu cuenta e inicia sesion\" button\r\n    Then The email address has been linked to the lifemiles account.\r\n    And Redirect to account\/overview section\r\n\r\n    Examples:\r\n      | tst |\r\n      | tst |\r\n\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @TEST_TS-1161\r\n  Scenario Outline: [CypressCoverage] manually link the google account to a lifemiles account at that email address\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the second button that contains the text \"Continuar con Google\"\r\n    Then The google authentication section loads\r\n    When I type the \"<gmail>\" in the \"Correo electronico\" field and the \"<Password>\" in the \"Contrasena\" field\r\n    Then I click on the \"Ingresar\" button\r\n    When Loads the view \"Tu correo está asociado con una cuenta LifeMiles\"\r\n    And last 4 digits of the associated membershipnumber is preloaded in the \"Numero de LifeMiles\"\r\n    Then I click on the \"Vincula otra cuenta\" link\r\n    When Loads the view \"Vincula tu cuenta LifeMiles\"\r\n    And The \"Numero LifeMiles\" field is empty\r\n    When I type the \"<membershipnumber>\" in the \"Numero LifeMiles\" field and \"<LifemilesPassword>\" in the \"Contrasena\" field\r\n    And I click on the \"Mostrar\" button\r\n    When I click on the \"Vincula tu cuenta e inicia sesion\" button\r\n    Then The email address has been linked to the lifemiles account.\r\n    And Redirect to account\/overview section\r\n\r\n    Examples:\r\n      | tst |\r\n      | tst |\r\n\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @NA @TEST_TS-1199\r\n  Scenario Outline: [CypressCoverage] manual linking of google account to lifemiles account from intermediary mode\r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the second button that contains the text \"Continuar con Google\"\r\n    Then The google authentication section loads\r\n    When I type the \"<gmail>\" in the \"Correo electronico\" field and the \"<Password>\" in the \"Contrasena\" field\r\n    Then I click on the \"Ingresar\" button\r\n    When Loads the \"Tu correo electrónico de Gmail no está asociado a una cuenta lifemiles\" modal\r\n    Then I click on the \"Vincula tu cuenta\" button\r\n    When Loads the view \"Vincula tu cuenta LifeMiles\"\r\n    And The \"Numero LifeMiles\" field is empty\r\n    When I type the \"<membershipnumber>\" in the \"Numero LifeMiles\" field and \"<LifemilesPassword>\" in the \"Contrasena\" field\r\n    And I click on the \"Mostrar\" button\r\n    When I click on the \"Vincula tu cuenta e inicia sesion\" button\r\n    Then The email address has been linked to the lifemiles account.\r\n    And Redirect to account\/overview section\r\n\r\n    Examples:\r\n      | tst |\r\n      | tst |\r\n\r\n\r\n  @website-authentication-ui @WebsiteCoverage @AP_Social%20manager @Social%20manager @NA @TEST_TS-1200\r\n  Scenario Outline: [CypressCoverage] account enrollment and automatic linking from intermediary mode \r\n    Given I enter the Social Manager Section\r\n    When The Social Login section has loaded, click on the second button that contains the text \"Continuar con Google\"\r\n    Then The google authentication section loads\r\n    When I type the \"<gmail>\" in the \"Correo electronico\" field and the \"<Password>\" in the \"Contrasena\" field\r\n    Then I click on the \"Ingresar\" button\r\n    When Loads the \"Tu correo electrónico de Gmail no está asociado a una cuenta lifemiles\" modal\r\n    Then I click on the \"crea tu cuenta\" link\r\n    When Loads the view \"Crea tu cuenta\" social enrollment Step 1\r\n    And The \"<gmail>\" is preloaded in the \"Correo electronico\" field\r\n    When I type the \"<Password>\" in the \"Contrasena\" field\r\n    And I type the \"<PasswordConfirmation>\" in the \"Confirmar contrasena\" field\r\n    Then I click on the \"Siguiente\" button\r\n    When Loads the view \"Cuentanos un poco mas de ti\" social enrollment Step 2\r\n    Then The \"<firstName>\" is preloaded in the \"Nombre\" field and \"<lastName>\" in the \"Apellido\" field\r\n    When I select the \"<residenceCountry>\" from the \"Pais de residencia\" dropdown\r\n    Then I select the birth date \"<month>\",\"<day>\",\"<year>\" in the dropdowns\r\n    When I type the \"numberID\" in the \"Identificador Nacional\" field\r\n    Then I select the \"<issuingCountry>\" in the \"Pais emisor\" dropdown\r\n    When I check the \"termsAndConditions\" checkbox\r\n    Then I check the \"privacypolicies\" checkbox\r\n    When I validate that there is no mistake in the information entered in the fields \r\n    Then I click on the \"Afiliate a Lifemiles\" button\r\n    And Redirect to account\/overview section\r\n\r\n    Examples:\r\n      | tst |\r\n      | tst |","uri":"cypress\\e2e\\SocialLoginLMCOM.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":1,"column":1},"language":"en","keyword":"Feature","name":"[CypressCoverage][website-authentication-ui] Authentication Social login","description":"","children":[{"scenario":{"id":"315f1d21-a610-4e95-8eee-1c7ea2d9c526","tags":[{"location":{"line":3,"column":3},"name":"@website-authentication-ui","id":"8f220a42-67f5-4340-a72f-fd0368485638"},{"location":{"line":3,"column":30},"name":"@WebsiteCoverage","id":"37492bfc-dee2-4d5d-90db-41700b8653fe"},{"location":{"line":3,"column":47},"name":"@AP_Social%20manager","id":"6d8e50b7-d286-4afc-9c80-16636b6930a4"},{"location":{"line":3,"column":68},"name":"@Social%20manager","id":"50393546-2fa2-4fa9-8055-f7e3759ac3b8"},{"location":{"line":3,"column":86},"name":"@TEST_TS-1081","id":"912b82ca-9bc0-4867-9303-5c6ce6f5931b"}],"location":{"line":4,"column":3},"keyword":"Scenario Outline","name":"[CypressCoverage] Successful login with google account","description":"","steps":[{"id":"77264d39-a41c-4a99-85ea-0dba00b05b47","location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"I enter
